import React from 'react';
import './style.css';
import node from '../../assets/icons/node.png';
import sql from '../../assets/icons/sql.png';
import python from '../../assets/icons/python.png';
import nosql from '../../assets/icons/nosql.png';
import docker from '../../assets/icons/docker.png';
import git from '../../assets/icons/git.png';
import aws from '../../assets/icons/aws.png';
import API_REST from '../../assets/icons/API_REST.png';
import java from '../../assets/icons/java.png';
import cpp from '../../assets/icons/cpp.png';
import c from '../../assets/icons/c.png';
import js from '../../assets/icons/js.png';
import ts from '../../assets/icons/ts.png';
import react from '../../assets/icons/react.png';
import react_native from '../../assets/icons/react_native.png';
import expo from '../../assets/icons/expo.png';
import php from '../../assets/icons/php.png';
import mongoDb from '../../assets/icons/mongoDb.png';
import postgreSQL from '../../assets/icons/postgreSQL.png';

const translations = {
  'pt-BR': {
    title: 'Ferramentas e Tecnologias',
    technologies: {
      node: 'Node.js',
      python: 'Python',
      sql: 'SQL',
      nosql: 'NoSQL',
      docker: 'Docker',
      git: 'Git',
      aws: 'AWS',
      API_REST: 'RESTful APIs',
      java: 'Java',
      cpp: 'C++',
      c: 'C',
      js: 'JavaScript',
      ts: 'TypeScript',
      react: 'React',
      react_native: 'React Native',
      expo: 'Expo',
      php: 'PHP',
      mongoDb: 'MongoDB',
      postgreSQL: 'PostgreSQL'
    }
  },
  en: {
    title: 'Tools and Technologies',
    technologies: {
      node: 'Node.js',
      python: 'Python',
      sql: 'SQL',
      nosql: 'NoSQL',
      docker: 'Docker',
      git: 'Git',
      aws: 'AWS',
      API_REST: 'RESTful APIs',
      java: 'Java',
      cpp: 'C++',
      c: 'C',
      js: 'JavaScript',
      ts: 'TypeScript',
      react: 'React',
      react_native: 'React Native',
      expo: 'Expo',
      php: 'PHP',
      mongoDb: 'MongoDB',
      postgreSQL: 'PostgreSQL'
    }
  }
};

const Tecnologias = ({ language }) => {
  const translation = translations[language];

  const toolsTechnologies = [
    { key: 'node', alt: translation.technologies.node },
    { key: 'python', alt: translation.technologies.python },
    { key: 'sql', alt: translation.technologies.sql },
    { key: 'nosql', alt: translation.technologies.nosql },
    { key: 'docker', alt: translation.technologies.docker },
    { key: 'git', alt: translation.technologies.git },
    { key: 'aws', alt: translation.technologies.aws },
    { key: 'API_REST', alt: translation.technologies.API_REST },
    { key: 'java', alt: translation.technologies.java },
    { key: 'cpp', alt: translation.technologies.cpp },
    { key: 'c', alt: translation.technologies.c },
    { key: 'js', alt: translation.technologies.js },
    { key: 'ts', alt: translation.technologies.ts },
    { key: 'react', alt: translation.technologies.react },
    { key: 'react_native', alt: translation.technologies.react_native },
    { key: 'expo', alt: translation.technologies.expo },
    { key: 'php', alt: translation.technologies.php },
    { key: 'mongoDb', alt: translation.technologies.mongoDb },
    { key: 'postgreSQL', alt: translation.technologies.postgreSQL }
  ];

  return (
    <div className="tecnologias">
      <div>
        <h2>{translation.title}</h2>
        <ul>
          {toolsTechnologies.map((tool, index) => (
            <li key={index}>
              <img src={require(`../../assets/icons/${tool.key}.png`).default} alt={tool.alt} className="imgLogo" />
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Tecnologias;
